SafeAddString(SI_DELETE_CHARACTER_DIALOG_GAMEPAD_TEXT, "Ihr könnt im Augenblick <<1>> <<1[/Charakter/Charaktere]>> löschen.\n\n|cff9633Wenn Ihr einen Charakter löscht, der Gegenstände im Inventar besitzt, die Ihr über den Kronen-Shop oder durch einen Freischaltcode erhalten habt, so werden diese beim Löschen verloren gehen.|r\n\nSolltet Ihr diese Gegenstände behalten wollen, so sucht die nächste Bank auf und lagert diese Gegenstände für einen Eurer anderen Charaktere ein.\n\nSammlungsgegenstände, wie Reittiere, Begleiter, Kostüme und Kontoerweiterungen gehen dabei nicht verloren.\n\nNormale Gegenstände, die ausgerüstet sind oder sich im Inventar befinden, werden ebenfalls zerstört.", 1)
SafeAddString(SI_DELETE_CHARACTER_DIALOG_GAMEPAD_TITLE, "Charakter löschen", 0)
SafeAddString(SI_DELETE_CHARACTER_DIALOG_TEXT, "|cff0000Wenn Ihr einen Charakter löscht, der Gegenstände im Inventar besitzt, die Ihr über den Kronen-Shop oder durch einen Freischaltcode erhalten habt, so werden diese beim Löschen verloren gehen.|r\n\nSammlerstücke, wie Pferde, Begleiter, Kostüme oder Kontoverbesserungen bleiben erhalten. Normale Gegenstände, die ausgerüstet sind oder sich im Inventar befinden, werden ebenfalls zerstört. Solltet Ihr diese Gegenstände behalten wollen, so sucht die nächste Bank auf und lagert diese Gegenstände für einen Eurer anderen Charaktere ein.\n\nIhr könnt noch |cFFFFFF<<4>>|r <<4[/Charakter/Charaktere]>> löschen. Weitere Charaktere können nach etwas vergangener Zeit gelöscht werden.\n\nSeid Ihr sicher, dass Ihr den |cFFFFFF<<1>>|r löschen wollt? Schreibt |cFFFFFF<<2>>|r, um dies zu bestätigen und klickt dann auf <<3>>.", 3)
