SafeAddString(SI_ZONECOMPLETIONTYPE_DESCRIPTION1, "|cffffffQuests der Erzählung|r gehören zum Erzählstrang des Gebiets. Durch das Abschließen dieser Quests könnt Ihr Fertigkeitspunkte, Erfahrung, Gold und Ausrüstung erhalten.", 2)
SafeAddString(SI_ZONECOMPLETIONTYPE_DESCRIPTION10, "|cffffffMarkante Orte|r sind Schauplätze, die es zu erkunden lohnt. Durch das Erkunden aller markanten Orte in einem Gebiet erhält man die Pfadfinder-Errungenschaft.", 2)
SafeAddString(SI_ZONECOMPLETIONTYPE_DESCRIPTION11, "Die Bücher aus |cffffffShalidors Bibliothek|r sind in der ganzen Welt verteilt. Die Bücher sind an ihrem bläulichen Schimmer zu erkennen, und ihre Entdeckung verbessert Euren Ruf innerhalb der Magiergilde und damit auch deren Fertigkeitslinie.", 2)
SafeAddString(SI_ZONECOMPLETIONTYPE_DESCRIPTION12, "|cffffffMundussteine|r sind magische Monumente, die einen permanenten Segen gewähren. Dieser Stärkungszauber bleibt erhalten, bis er vom Segen eines anderen Mundussteins überschrieben wird.", 2)
SafeAddString(SI_ZONECOMPLETIONTYPE_DESCRIPTION13, "|cffffffOffene Verliese|r finden sich in ganz Tamriel und darüber hinaus. Sie sind für Vierergruppen ausgelegt, können aber frei betreten werden. Durch das Abschließen von Teilen der offenen Verliese erhaltet Ihr Fertigkeitspunkte, Erfahrung, Gold und Ausrüstung.", 3)
SafeAddString(SI_ZONECOMPLETIONTYPE_DESCRIPTION14, "An |cffffffSetwerkstätten|r können Handwerker Ausrüstungsgegenstände mit besonderen Setboni herstellen.", 2)
SafeAddString(SI_ZONECOMPLETIONTYPE_DESCRIPTION2, "|cffffffInteressante Orte|r sind in sich geschlossene Geschichten, bei denen Ihr die Geschichte, Charaktere und Orte in einem Gebiet kennenlernen könnt. Dadurch erhaltet Ihr Erfahrung, Gold und Ausrüstung.", 3)
SafeAddString(SI_ZONECOMPLETIONTYPE_DESCRIPTION4, "Ihr könnt kostenlos zwischen |cffffffWegschreinen|r reisen, indem Ihr diese entdeckt und später erneut aktiviert. Alternativ könnt Ihr auch von fast jedem beliebigen Ort gegen eine kleine Gebühr direkt zu einem Wegschrein Eurer Wahl reisen.", 3)
SafeAddString(SI_ZONECOMPLETIONTYPE_DESCRIPTION5, "|cffffffGewölbe|r sind Verliese in der Welt, die alleine bewältigt werden können. Im Inneren befindet sich immer eine Himmelsscherbe und vom Anführer können Setgegenstände erlangt werden.", 2)
SafeAddString(SI_ZONECOMPLETIONTYPE_DESCRIPTION6, "|cffffffGruppengewölbe|r sind Verliese in Kargstein, die für Vierergruppen ausgelegt sind. Im Inneren befindet sich immer eine Himmelsscherbe und vom Anführer können Setgegenstände erlangt werden.", 2)
SafeAddString(SI_ZONECOMPLETIONTYPE_DESCRIPTION7, "|cffffffHimmelsscherben|r sind über die gesamte Welt verteilt und an dem weithin ausgestrahlten weißen Licht erkennbar. Wenn Ihr drei gesammelt habt, erhaltet Ihr einen Fertigkeitspunkt, mit dem Ihr Eure Fähigkeiten verbessern oder neue freischalten könnt.", 2)
SafeAddString(SI_ZONECOMPLETIONTYPE_DESCRIPTION8, "|cffffffWeltereignisse|r, wie Dunkle Anker, sind Aktivitäten, die am besten mit einer Gruppe von Abenteurern angegangen werden. Durch das Abschließen von Weltereignissen erhaltet Ihr Erfahrung, Gold und hochwertige Ausrüstung.", 2)
SafeAddString(SI_ZONECOMPLETIONTYPE_DESCRIPTION9, "|cffffffAnführer der offenen Welt|r sollten am besten mit einer Gruppe von Abenteurern bekämpft werden. Durch das Besiegen von Anführern erhaltet Ihr hochwertige Ausrüstung.", 2)
